import React, { Component } from 'react'

export class User_profile extends Component {

    constructor(props) {
        super(props);
        this.state = {profiles: []};
    }

    render() {
        console.log(this.state.profiles)
        return (
            <div>
                <h1>Profiles</h1>
            </div>
        )
    }
}

export default User_profile
